let initMoney ={   //创建初始值
    title:"我的页"
};
let reducer = (state = initMoney,action)=>{    //创建   redux
    switch (action.type){
        case "WWW":state.title = "我的页" ; return {...state};
        case "NNN":state.title = "你的页" ; return {...state};
        default: return state
    }
};


export default reducer
